import React, { useState, useEffect } from 'react';
import { Helmet } from 'react-helmet';
import styled from 'styled-components';

const ServicesContainer = styled.div`
    // Your .services-container CSS here
`;

const Heading = styled.div`
    // Your .heading CSS here
`;

const Content = styled.div`
    // Your .content CSS here
`;

const ServicesList = styled.div`
    // Your .services-list CSS here
`;

const ServiceCard = styled.div`
    // Your .service-card CSS here
`;

// Continue for other classes...

const Services = () => {
  const [services, setServices] = useState([]);
  useEffect(() => { /* Your code here */ }, []);

  return (
    <ServicesContainer>
      <Helmet>
        <title>Our Services | Techbitz.io - Crafting Digital Success</title>
        <meta name="description" content="At Techbitz.io, we offer a wide array of digital services including web design, development, SEO, digital marketing, and testing services for business growth." />
      </Helmet>
      <Heading>
        <h2>Services Tailored to Your Business Needs</h2>
      </Heading>
      <Content>
        <p>At Techbitz.io, we provide an extensive suite of digital services designed to transform your online business...</p>
      </Content>
      <ServicesList>
        {services.map(service => (
          <ServiceCard key={service.id}>
            <img src={`/images/${service.img}`} alt={service.title} />
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </ServiceCard>
        ))}
      </ServicesList>
    </ServicesContainer>
  );
}

export default Services;
